    componentDidMount(){
      anxios.get('https://jsonplaceholder.typicode.com/todos/1').then((result)=>this.setState({
        users: result.data
      }))

    }
    render(){
      return(
        <div className="App">
          <Router>
            <div>
              <Nav />
              <Switch>
                <Route exactly component={UsersPage} pattern="/UsersLink/:user
              " />
                <Route exactly component={PostsPage} pattern="/PostsLink" />
